public func randomGivenName() -> String {
    return firstNames.randomElement
}
public func randomFamilyName() -> String {
    return lastNames.randomElement
}

extension Collection where IndexDistance == Int {
    public var randomElement: Iterator.Element {
        let offset = arc4random_uniform(UInt32(count))
        let idx = index(startIndex, offsetBy: Int(offset))
        return self[idx]
    }
}

